itution: json["institution"],    reminderTime: DateTime.parse(json["reminderTime"]),  );  Map<String, dynamic> toJson() => {    "published": published,    "routineReminder": routineReminder,    "_id": id,    "title": title,    "batch": batch,    "lecturer": lecturer,    "block": block,    "classRoom": classRoom,    "classLink": classLink,    "start": start?.toIso8601String(),    "end": end?.toIso8601String(),    "moduleSlug": moduleSlug,    "institution": institution,    "reminderTime": reminderTime?.toIso8601String(),  };}